  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0130931 includes physical
  and profile data collected aboard NOAA Ship FAIRWEATHER during project OPR-S313-FA-10
  in the Bering Sea from 2010-07-21 to 2010-08-30. These data include CONDUCTIVITY,
  HYDROSTATIC PRESSURE, SALINITY, SOUND VELOCITY, WATER DENSITY and WATER TEMPERATURE.
  The instruments used to collect these data include CTD and sound velocimeter - moving
  vessel profiler. These data were collected and submitted by the NOAA Office of Coast
